local function translationAnim(x, y,delay)
    local anim = Animation():translation(x, y):duration(0.4):delay(delay):interpolator(Interpolator.ACCELERATE_DECELERATE)
    return anim
end


local function getScale()
    local screenW, screenH = Native:getVideoSize(2)
    return math.min(screenW, screenH) / 375
end

local function startViewTranslationAnim(view, x, y, table,delay)
    if (view == nil) then
        return nil
    end
    if table ~= nil then
        return translationAnim(x, y,delay):with(view):callback(table):start()
    else
        return translationAnim(x, y,delay):with(view):start()
    end
end

-- 设置label属性
local function labelSetProperty(label, fontSize, textColor, text)

    label:fontSize(fontSize)
    label:textColor(textColor)
    label:text(text)
end

local function judgeString(str)
	
	if str ~= nil and #str > 0 then
		return str
	else
		return " - "
	end
end

local function addSidebarViewNetWork(tag_id)

    local dic = {}
    dic["labelId"] = tag_id
    dic["isAnimation"] = videoWindow.isAnimation
    if videoWindow.isAnimation == nil then
    	dic["isAnimation"] = "1"
    end

    if videoWindow.miniAppId ~= nil then
    	Native:sendAction(Native:base64Encode("LuaView://applets?appletId=" .. videoWindow.miniAppId .. "&template=os_video_starContent_hotspot.lua&id=os_video_starContent_hotspot"..math.random(1,10000)),dic)
    end
end

