-- 添加顶部tabView
local function addTopView(superView)
	local screenWidth, screenHeight = Applet:appletSize()

	local topView = View()
	topView:onClick(function () end)
	videoWindow.topView = topView
	topView:backgroundColor(0x2E323A)
	topView:frame(0,0,screenWidth,33*getScale())
	if (System.android()) then
        topView:align(Align.RIGHT)
    end
    superView:addView(topView)

    local W = (screenWidth / 2 - 50) / 2

    local leftlabel = initLabel("相关明星",topView)
    videoWindow.leftlabel = leftlabel
    leftlabel:textColor(0x2ECF80)
    leftlabel:frame(W,7,60,17)
    leftlabel:callback(function()
		videoWindow.rightlabel:textColor(0x767A80)
		videoWindow.indicateView:frame(leftlabel:x(),topView:height() - 2,leftlabel:width(),2)
		leftlabel:textColor(0x2ECF80)
		videoWindow.scrollView:offset(0,0,true);
    end)
 
	local rightlabel = initLabel("推荐明星",topView)
	videoWindow.rightlabel = rightlabel
	rightlabel:frame(screenWidth / 2 + W,7,60,17)
	rightlabel:callback(function()
		videoWindow.leftlabel:textColor(0x767A80)
		videoWindow.indicateView:frame(rightlabel:x(),topView:height() - 2,rightlabel:width(),2)
		rightlabel:textColor(0x2ECF80)
  		videoWindow.scrollView:offset(screenWidth,0,true);
    end)

	local indicateView = View()
    videoWindow.indicateView = indicateView
   	indicateView:backgroundColor(0x2ECF80)
	indicateView:frame(leftlabel:x(),topView:height() - 2,leftlabel:width(),2)
    topView:addView(indicateView)

    return topView
end

local function layoutCellView(cell,data)
	cell.cellHeaderImage:image(data.coverPhotoUrl)
	if (System.android()) then
		labelSetProperty(cell.nameLabel,14 * getScale(),0x444B57,judgeString(data.cnName))
		labelSetProperty(cell.aliasLabel,10 * getScale(),0xA1A8B3,"别名: "..judgeString(data.aliasName))
		labelSetProperty(cell.fansNameLable,10 * getScale(),0xA1A8B3,"粉丝昵称: "..judgeString(data.fansName))

	else
