-- 初始化 相关和推荐明星列表
local function initCollectionView(superView,data)

	  local screenWidth, screenHeight = Applet:appletSize()

	  local collectionView = CollectionView{
	    	 Section = {
	                SectionCount = function()
	                	return 2
	                end,
	                RowCount = function(section)

	                	if section == 1 then
	                		return #data
	                	end
	                	return 1
	                end
	            },

	         Cell = {
		          	Id = function(section, row)
		          		if section == 1 then
		          			return "correlationCell"
		          		end
		            	return "emptypageCell"
		            end,
		            correlationCell = {
		            	Size = function(section, row)
	                    	return screenWidth,cellHeight + 10
		                end,

		                Init = function(cell, section, row)
		               
	                    	initScrollViewSubView(cell,data[row])
		               	end,

		               	Layout = function(cell, section, row)
	                    	layoutCellView(cell,data[row])

	                    	cell.cellFigureView:onClick(function()
								addSidebarViewNetWork(data[row].labelId)
							end);	                    	
	                    end,
		            },
		            emptypageCell = {
		            	Size = function(section, row)
	                    	return screenWidth,28
		                end
		            },
	          },
	    }

	    collectionView:showScrollIndicator(true)
	    collectionView:backgroundColor(0x333740)
	    superView:addView(collectionView)
	    return collectionView
end

-- 初始化错误页面和推荐明星VIew
local function initErrorCollectionView(superView,data)
	local screenWidth, screenHeight = Applet:appletSize()

	local collectionView = CollectionView {
		Section = {
	            SectionCount = function()
	            	return 4
	            end,
	            RowCount = function(section)

	            	if section == 3 then
						if data ~= nil then
	                		return #data
	                	end
	            	else
	            		return 1
	            	end
	            end
	    },

	    Cell = {
	          	Id = function(section, row)
	            	if section == 1 then
	            		return "errorCell"
	            	elseif section == 2 then
	            		return "hintCell"
	            	elseif section == 3 then
	            		return "recommendCell"
	            	elseif section == 4 then
	            		return "emptypageCell"
	            	end       
	            end,
	            errorCell = {
	            	Size = function(section, row)
	                	return screenWidth,170	                    	
	                end,

	                Init = function(cell, section, row)
	                	errorView(cell)
	               	end
	            },
	            hintCell = {
	            	Size = function(section, row)
	            		return screenWidth, 32 * getScale()
	                end,

	                Init = function(cell)
	                	recommendView(cell)
	               	end
	            },
	            recommendCell = {
	            	Size = function(section, row)
	            		if data ~= nil then
	                		return screenWidth,cellHeight + 10
	                	end
	                end,

	                Init = function(cell, section, row)
	                	if data ~= nil then
	                		initScrollViewSubView(cell,data[row])
	                	end
	               	end,

	               	Layout = function(cell, section, row)

	               		if data ~= nil then
	                		layoutCellView(cell,data[row])

	                		cell.cellFigureView:onClick(function()
								addSidebarViewNetWork(data[row].labelId)
							end);
	                	end
	                	
	                end,
	            },

	            emptypageCell = {
	            	Size = function(section, row)
                    	return screenWidth,28
	                end
		        },
	    },
	}
	videoWindow.collectionView = collectionView
	collectionView:showScrollIndicator(true)
	collectionView:backgroundColor(0x333740)
    collectionView:frame(0, 0, superView:width(),superView:height())
    superView:addView(collectionView)
end


local function addscrollView()
	local screenWidth, screenHeight = Applet:appletSize()

    local sidebarView = View()
    videoWindow.sidebarView = sidebarView
    sidebarView:backgroundColor(0x333740,1)
    sidebarView:frame(0, 0, screenWidth, screenHeight)
    if (System.android()) then
        sidebarView:align(Align.RIGHT)
    end

    if videoWindow.relationStarsData ~= nil then

    	local topView = addTopView(sidebarView)

		local scrollView = nil
		if(System.android())then
		  	scrollView = HScrollView()
		else
		  	scrollView = ScrollView()
		end
	    videoWindow.scrollView = scrollView
	    scrollView:callback{
	        ScrollEnd = function()
	        	local x, y = scrollView:offset()
	        	if x > screenWidth / 2 then
	        		scrollView:offset(screenWidth,0,true);
	        		videoWindow.leftlabel:textColor(0x767A80)
					videoWindow.indicateView:frame(videoWindow.rightlabel:x(),videoWindow.topView:height() - 2,videoWindow.rightlabel:width(),2)
					videoWindow.rightlabel:textColor(0x2ECF80)
	        	else
	        		scrollView:offset(0,0,true);
	        		videoWindow.rightlabel:textColor(0x767A80)
					videoWindow.indicateView:frame(videoWindow.leftlabel:x(),videoWindow.topView:height() - 2,videoWindow.leftlabel:width(),2)
					videoWindow.leftlabel:textColor(0x2ECF80)	        		
	        	end
	        end
		};
		scrollView:frame(0, topView:height(), sidebarView:width(), sidebarView:height() - topView:height())
		sidebarView:addView(scrollView)

	    local leftcollectionView = initCollectionView(scrollView,videoWindow.relationStarsData)
	    videoWindow.leftcollectionView = leftcollectionView
	    leftcollectionView:frame(0,5, scrollView:width(), scrollView:height())

	    local rightcollectionView = initCollectionView(scrollView,videoWindow.hotStarsData)
	    videoWindow.rightcollectionView = rightcollectionView
	    rightcollectionView:frame(screenWidth,5, scrollView:width(), scrollView:height())

	    videoWindow.scrollView:contentSize(screenWidth * 2,0)

    else

    	initErrorCollectionView(sidebarView,videoWindow.hotStarsData)
    end

    local bottomImage = Image()
    videoWindow.bottomImage = bottomImage 
    bottomImage:frame(0,screenHeight - 94,screenWidth,94)
    bottomImage:image(Data(maskingImage))
    sidebarView:addView(bottomImage) 
end 



function toTable(data)
    local dataTable
    if (type(data) == 'string') then
        if (System.android()) then
            dataTable = Json:toTable(data)
        else
            dataTable = Native:jsonToTable(data)
        end
    else
        dataTable = data
    end
    return dataTable
end

function videoHttpRequest()


	local paramData = {
        commonParam = Native:commonParam(),
        videoId = Native:nativeVideoID()
    }
    
    local paramDataString = Native:tableToJson(paramData)

	local OS_HTTP_PUBLIC_KEY = Native:appSecret()
    local OS_HTTP_HOST = Native:videoOShost()
    local OS_HTTP_POST_CONTENT_APPID = OS_HTTP_HOST .. "/vision/hotStar/list"

    videoWindow.request = HttpRequest()

	videoWindow.request:post(OS_HTTP_POST_CONTENT_APPID, {
	        key = OS_HTTP_PUBLIC_KEY,
	        data = Native:aesEncrypt(paramDataString, OS_HTTP_PUBLIC_KEY, OS_HTTP_PUBLIC_KEY)
	        -- data = ""
	    },function (response,errorInfo)
	    	
	        if (response == nil) then
	            print("error:",errorInfo)
	            Applet:showRetryPage("网络开小差啦，请重试")
	            return
	        end
	        
	        local responseData = Native:aesDecrypt(response.encryptData, OS_HTTP_PUBLIC_KEY, OS_HTTP_PUBLIC_KEY)
	        response = toTable(responseData)
	       	print("====",Native:tableToJson(response.data))
	        if response.resCode == "00" then

	        	if response.data ~= nil then
	        		if response.data.hotStars ~= nil then
	        			-- 推荐明星数据
                    	videoWindow.hotStarsData = response.data.hotStars                    	
	        		end

	        		if response.data.relationStars ~= nil and #response.data.relationStars > 0 then
	        			-- 相关明星数据
						videoWindow.relationStarsData = response.data.relationStars
	        		end
	        		addscrollView()
	        		
	        	end
			else
				Applet:showErrorPage("未找到匹配结果，换个标签再试")
	        end
	end)
end

function event(data)

	if tostring(data.eventType) == "2" then
		
		-- 网络重试
		if tostring(data.appletActionType) == "1" then
			videoHttpRequest()
		end
		-- refresh
		if tostring(data.appletActionType) == "2" then

			if data.data ~= nil and data.data.labelId ~= nil then
				videoHttpRequest()
				addSidebarViewNetWork(data.data.labelId)
			else
				
				videoHttpRequest()
			end
		end
	end
end


function show(args)

 

	if args.appletId ~= nil then
		videoWindow.miniAppId = args.appletId
	end


	if (Native.commonTrack) then

		local infoDic = {}
	 	infoDic["appletId"] = videoWindow.miniAppId
	 	infoDic["userId"]   = Native:getIdentity()
	 	infoDic["pageName"] = "figureStarList"
	 	Native:commonTrack(8, infoDic)
	end

    if args.data ~= nil and args.data.isAnimation ~= nil then
    	videoWindow.isAnimation = args.data.isAnimation
	end

	
	videoHttpRequest()
	if args.data ~= nil and args.data.labelId ~= nil then
		addSidebarViewNetWork(args.data.labelId)

	end
end



























